scriptlet.script:
try {
	var sql = "select EAL.INSTANCE,EAL.CUSTOMER,EL.PROGRAM,EL.SUITE,EL.REGION from ENA_ACTIVE_LABS EAL join ENA_LABS EL on EL.ID = EAL.LAB_ID where EAL.REQUEST = '" + requestId + "'"; 
	scriptletResult = sql;
	scriptletContext.put("SQL",sql);
	scriptletResponse = "success";
}
catch(Error) {
	scriptletResponse = "failure";
	scriptletContext.put("FailureMessage",Error);
}

try {
	var sql = "update ENA_ACTIVE_LABS set SUBSCRIPTION_NAME = '" + subscriptionName + "' where REQUEST = '" + requestId + "'";
	scriptletResult = sql;
	scriptletContext.put("SQL",sql);
	scriptletResponse = "success";
}
catch(Error) {
	scriptletResponse = "failure";
	scriptletContext.put("FailureMessage",Error);
}

var pr = scriptletContext.get("RS_Previous_Response");
try{
	switch(pr) {
		case "more items":
			if(output.trim().length > 0) {
				//select EAL.INSTANCE,EAL.CUSTOMER,EAL.START_DATE,EL.PROGRAM,EL.SUITE,EL.REGION,EL.MAX_DURATION 
				//select EAL.INSTANCE,EAL.CUSTOMER,EL.PROGRAM,EL.SUITE,EL.REGION 
				var enaArray = output.split("|");
				scriptletContext.put("enaArray",JSON.stringify(enaArray));
			}
			scriptletResponse = "more";
		break;

		case "no more items":
			var enaArray = scriptletContext.get("enaArray");
			if(enaArray != undefined) {
				var sn = parseName(enaArray);
				scriptletContext.put("subscriptionName",sn);
				scriptletResponse = "complete";
			}
			else {
				throw new Error("Subscription: " + subscriptionId + " not found in ENA_ACTIVE_LABS");
			}
		break;

		case udefined:
			throw new Error("Datatabse Error:" + output);
		break;
	}
}
catch(Error) {
	scriptletResponse = "failure";
	scriptletContext.put("FailureMessage",Error);
}

function parseName(enaArray) {
	var array = JSON.parse(enaArray);
	var instance = array[0];
	var customer = array[1];
	var program = array[2];
	var suite = array[3];
	var region = array[4];
	var sn = program;
	sn = (suite != "null")? sn.concat("-",suite): (customer!= "null")? sn.concat("-",customer) : sn;
	sn = (region != "null")? sn.concat("-",region): sn;
	sn = sn.concat("-LAB",instance);
	return sn;
}
